/**
 * @name TheOnePiece
 * @author Erdi
 * @description Every time "the one piece is real" or "can we get much higher" is said, the iconic meme sound is played
 * @version 1.0.0
 */

const name = "TheOnePiece";

let audio;
const messageBoxClass = "scrollerInner-2PPAp2";//"scroller-kQBbkU";
const audioElemId = "one-piece-audio";
let checkInterval;

module.exports = meta => ({
	start() {
		getAudio(); // put audio in memory

		const that = this;

		function listen() {
			const messageBox = document.getElementsByClassName(messageBoxClass)[0];

			if(!messageBox) {
				setTimeout(listen, 500);
				return;
			}

			checkInterval = setInterval(() => {
				if(!messageBox.isConnected) {
					messageBox.remove();

					if(this.observer)
						this.observer.disconnect();

					listen();
					clearInterval(checkInterval);
				}
			}, 5000);

			this.observer = new MutationObserver((mutationsList, observer) => {
				let isTheOnePieceReal = false;

				for(const mutation of mutationsList) {
					if(isTheOnePieceReal || this.audioElem)
						break;

					for(const node of mutation.addedNodes) {
						const lower = node.textContent.toLowerCase();
						isTheOnePieceReal = lower.includes("the one piece is real") || lower.includes("can we get much higher");

						if(isTheOnePieceReal) {
							that.injectCSS(`#${node.id} .markup-eYLPri { color: yellow !important; }`);

							that.stopOnePiece();
							that.playOnePiece();
							break;
						}
					}
				}
			});

			this.observer.observe(messageBox, {characterData: false, childList: true, attributes: false});
		}
		listen();
	},

	stop() {
		audio = undefined; // clear "audio"

		if(this.observer)
			this.observer.disconnect();
		
		this.stopOnePiece();
		this.resetInjectedCSS();
	},

	resetInjectedCSS() {
		if(this.customStyle) {
			this.customStyle.remove();
			this.customStyle.textContent = "";
			this.customStyle = null;
		}
	},

	injectCSS(css) {
		this.customStyle = this.customStyle || document.createElement("style");
		this.customStyle.textContent += "\n" + css;

		if(!this.customStyle.isConnected)
			document.body.append(this.customStyle);
	},

	stopOnePiece() {
		for(const elem of document.getElementsByClassName(audioElemId)) {
			clearTimeout(elem.dataset.timeout);
			elem.remove();
		}
	},

	playOnePiece() {
		this.audioElem = new Audio(getAudio());
		this.audioElem.controls = true;
		this.audioElem.autobuffer = true;
		this.audioElem.autoplay = true;
		this.audioElem.id = audioElemId;
		this.audioElem.classList.add(audioElemId);

		this.audioElem.style = `
		position: absolute;
		left: 50%;
		transform: translateX(-50%);
		z-index: 999;
		`;

		document.body.append(this.audioElem);

		this.audioElem.onended = this.audioElem.remove;
		this.audioElem.onpause = this.audioElem.remove;

		this.audioElem.oncanplay = () => {
			this.audioElem.dataset.timeout = setTimeout(() => {
				this.resetInjectedCSS();
			}, this.audioElem.duration * 1000);
		};
	}
});

function getAudio() {
	if(!audio) {
		BdApi.showToast(name + ": Loading audio...");

		// raw audio
		audio = "data:audio/x-m4a;base64,";

		BdApi.showToast(name + ": Audio loaded! Approximately " + ((audio.length >> 10) / 1024).toFixed(2) + " MB in size");
	}

	return audio;
}
